import React, { useState, useEffect } from "react";
import "./App.css";
import { Route,Routes } from "react-router-dom";
import Login from "./pages/LoginPage";
import Dashboard from "./pages/Dashboard";
import Register from "./pages/Register";

function App() {
	// usestate for setting a javascript
	// object for storing and using data
	const [loggedin,setLogin]= useState(False);

	return (
		<div className="App">
		<Routes>
			<Route path="/" element={loggedin?<Dashboard loggedin={loggedin}/>:<Login setLogin={setLogin}/>}> </Route>
			<Route path="/login" element={<Login setLogin={setLogin}></Login>}></Route>

			<Route path="/register" element={<Register setLogin={setLogin}></Register>}></Route>
		</Routes>
		<Login/>

		</div>
	);
}

export default App;
